namespace FinalyProject
{
    class Program
    {
        static void Main(string[] args)
        {

            List<Stage> stages = new List<Stage>();
            CreateStage(10, stages);
            StageController stageController = new StageController(stages);
        }
        static void CreateStage(int countStage, List<Stage> stages)
        {
            for (int i = 0; i < countStage; i++)
            {
                Stage stage;

                if (i <= 3)
                {
                    stage = new Stage(false, StageLevel.Easy);
                }
                else if (i > 3 && i < 7)
                {
                    stage = new Stage(false, StageLevel.Normal);
                }
                else
                {
                    stage = new Stage(false, StageLevel.Hard);
                }

                stages.Add(stage);
            }
        }
    }
}

