#define _CRT_SECURE_NO_WARNINGS

#include <iostream>


using namespace std;

struct client {
	char name[30]; // имя клиента
	char phone_number[20]; // номер телефона
	int client_id; // id клиента
	int personal_discount; // размер скидки
	bool regular_customer; // постоянный покупатель (да / нет)
};

class client_base {

public:
	client_base() {
		clients = new client[100];
		clients_number = 0;
		clients_base_size = 100;
	}

	client_base(const int new_base_size) {
		clients = new client[new_base_size];
		clients_number = 0;
		clients_base_size = new_base_size;
	}

	void new_client(const char* name, const char* phone_number, const int client_id, const int personal_discount, const bool regular_customer) {
		if (clients_number == clients_base_size) {
			client* temp = new client[clients_base_size * 2];
			for (int i = 0; i < clients_number; i++) {
				temp[i] = clients[i];
			}
			delete[] clients;
			clients = temp;
			clients_base_size *= 2;
		}
		strcpy(clients[clients_number].name, name);
		strcpy(clients[clients_number].phone_number, phone_number);
		clients[clients_number].client_id = client_id;
		clients[clients_number].personal_discount = personal_discount;
		clients[clients_number].regular_customer = regular_customer;
		clients_number++;
	}

	void del_client(const char* name) {
		for (int i = 0; i < clients_number; i++) {
			if (!strcmp(clients[i].name, name)) {
				for (int j = i; j < clients_number - 1; j++) {
					clients[j] = clients[j + 1];
				}
				i--; // на случай идущих подряд клиентов с одинаковым именем (иначе второго перескакивает)
				clients_number--;
			}
		}

	}

	void find_client(const char* name) {
		for (int i = 0; i < clients_number; i++) {
			if (!strcmp(clients[i].name, name)) {
				cout << clients[i].name << ": номер " << clients[i].phone_number << ", id " << clients[i].client_id << ", скидка " << clients[i].personal_discount << " %";
				if (clients[i].regular_customer) {
					cout << ", постоянный покупатель";
				}
				cout << endl;
			}
		}
		cout << endl;
	}

	void show_all_clients() {
		for (int i = 0; i < clients_number; i++) {
			cout << clients[i].name << ": номер " << clients[i].phone_number << ", id " << clients[i].client_id << ", скидка " << clients[i].personal_discount << " %";
			if (clients[i].regular_customer) {
				cout << ", постоянный покупатель";
			}
			cout << endl;
		}
		cout << endl;
	}

	void show_regular_clients() {
		for (int i = 0; i < clients_number; i++) {
			if (clients[i].regular_customer) {
				cout << clients[i].name << ": номер " << clients[i].phone_number << ", id " << clients[i].client_id << ", скидка " << clients[i].personal_discount << " %" << endl;
			}
		}
		cout << endl;
	}

	~client_base() {
		delete[] clients;
	}


private:
	client* clients; // массив клиентов
	int clients_number; // количество клиентов
	int clients_base_size; // размер базы
};


int main() {

	setlocale(LC_ALL, "ru");

	client_base my_base(200);
	my_base.new_client("Иван", "+79111111111", 1129, 10, true);
	my_base.new_client("Вася", "+79111111222", 1130, 5, false);
	my_base.new_client("Олег", "+79111111333", 1131, 15, true);
	my_base.new_client("Мария", "+79111111444", 1132, 10, false);
	my_base.new_client("Галя", "+79111111555", 1133, 20, true);
	my_base.show_all_clients();

	my_base.del_client("Иван");
	my_base.show_regular_clients();

	my_base.find_client("Галя");
}

package WTGTimeHud;

