void sendValues_to_database(String lat, String lon, float alt, int speed, String gTime, int sat, int update)
{
  HTTPClient http;
  WiFiClient client;
  http.begin(client, serverName);
  http.addHeader("Content-Type", "application/x-www-form-urlencoded");
  String httpRequestData = "api_key=" + apiKeyValue
                           + "&latitude=" + lat
                           + "&longitude=" + lon
                           + "&altitude=" + String(alt)
                           + "&speed=" + String(speed)
                           + "&gtime=" + gTime
                           + "&satellites=" + String(sat)
                           + "&update=" + String(update);
