  String response = http.getString();
  Serial.print(httpResponseCode); Serial.print(" - "); Serial.println(response);
  http.end();
}

void ConnectToWifi()
{     
  if (!WiFi.isConnected()) {
    WiFi.config(gip, ggateway, subnet, dns);
    retriesWifi = 0;
    while (wifiMulti.run(connectTimeoutMs) != WL_CONNECTED) {
      Serial.print(".");
      retriesWifi++;
      if (retriesWifi == retriesWifiMax) 
      {
        Serial.print(AUTOWIFI); Serial.println(" not available");
        return;
      }
    };
      if (wifiMulti.run(connectTimeoutMs) == WL_CONNECTED) {
        Serial.print(WiFi.SSID()); Serial.print(","); Serial.print(WiFi.macAddress()); Serial.print(","); Serial.print(WiFi.localIP());
        Serial.println();  
      } else {
        Serial.println("Unable to connect Wifi");     
      }
  }
}

static void smartDelay(unsigned long ms)
{
  unsigned long start = millis();
  do 
  {
    while (gpsserial.available())
      gps.encode(gpsserial.read());
  } while (millis() - start < ms);
}

void getGPSData()
{
  satellites = gps.satellites.value();
  Serial.print("Number of satellites: "); Serial.print(satellites); Serial.println();
  if (gps.location.isUpdated())
