    speed = gps.speed.kmph();
    sprintf(gpsTime,"%04d/%02d/%02d %02d:%02d:%02d", gps.date.year() , gps.date.month() , gps.date.day() , gps.time.hour() , gps.time.minute() , gps.time.second());
    sprintf(latitude,"%2.8f", gps.location.lat());
    sprintf(longitude,"%2.8f", gps.location.lng());    
    altitude = gps.altitude.meters();

    Serial.print("GPS position: "); Serial.print(latitude); Serial.print(","); Serial.print(longitude); Serial.println();
    Serial.print("GPS altitude: "); Serial.print(altitude); Serial.println();
    Serial.print("GPS speed: "); Serial.print(speed); Serial.println();
    Serial.print("GPS time: "); Serial.print(gpsTime); Serial.println();

    sendValues_to_database(latitude, longitude, altitude, speed, gpsTime, satellites, 1);
  } 
}

