const arrayRange = (start, stop, step) =>
Array.from(
    { length: (stop - start) / step + 1 },
    (value, index) => start + index * step
);

console.log(arrayRange(1, 5, 1)); // [1,2,3,4,5]

#include <iostream>

using namespace std;

void init(int arr[], const int size) {
    for (int i = 0; i < size; i++) {
        arr[i] = rand() % 100;
    }
}

void print(int arr[], const int size) {
    for (int i = 0; i < size; i++) {
        cout << arr[i] << " ";
    }
    cout << endl;
}

void reverse(int arr[], const int size) {
    for (int i = 0; i < size / 2; i++) {
        int temp = arr[i];
        arr[i] = arr[size - 1 - i];
        arr[size - 1 - i] = temp;
    }
}

int main() {

	setlocale(LC_ALL, "ru");

    srand(time(NULL));

    const int size = 9;

    int arr[size];

    init(arr, size);

    print(arr, size);

    reverse(arr, size);

    print(arr, size);
}

#include <iostream>

using namespace std;

void lucky_number(int a) {
	if (a < 100000 || a > 999999) {
		cout << "Некорректный ввод" << endl;
	}
	else {
		int r1, r2, r3, r4, r5, r6;
		r1 = a / 100000;
		a %= 100000;
		r2 = a / 10000;
		a %= 10000;
		r3 = a / 1000;
		a %= 1000;
		r4 = a / 100;
		a %= 100;
		r5 = a / 10;
		a %= 10;
		r6 = a;

		r1 + r2 + r3 == r4 + r5 + r6 ? cout << "Число является счастливым" << endl : cout << "Число не является счастливым" << endl;
	}

	
}

int main() {

	setlocale(LC_ALL, "ru");

	lucky_number(123123);
	lucky_number(111123);
	
}
